import React from 'react';
import Card from './Card';

const Ways = () => {
    return (
        <>
            <section className="ways">
                <h1>Ways to work with us</h1>
                <button className="btn btn-outline-primary btnContact bg-primary text-white" type="contact">Contact Us</button>
                <div className="d-flex">
                    <Card title="Project Management" />
                    <Card title="Advanced Analytics" />
                    <Card title="Marketing & Dashboard" />
                </div>
            </section>
        </>
    );
};

export default Ways;
